import React from 'react';
import './Exercise2.css';
function Exercise2(){
    return(
        <div class="dstyle">
        <h1>Exercise 2</h1>
        <div class="divstyle">
        <div class="div1">Header</div>
        <br></br>
        <div class="div2">Hero</div>
        <div class="div3">Content</div>
        <div class="div4">Sidebar</div>
        <div class="div5">Footer</div>
        </div>
        </div>
    );
}

export default Exercise2;
